webpackJsonp([0x8607392393ce],{2846:function(e,a){e.exports={pathContext:{docHtml:'<h1>lodash v4.17.11</h1>\n<p>The <a href="https://lodash.com/">Lodash</a> library exported as <a href="https://nodejs.org/">Node.js</a> modules.</p>\n<h2>Installation</h2>\n<p>Using npm:</p>\n<pre><code class="language-shell">$ npm i -g npm\n$ npm i --save lodash\n</code></pre>\n<p>In Node.js:</p>\n<pre><code class="language-js">// Load the full build.\nvar _ = require(\'lodash\');\n// Load the core build.\nvar _ = require(\'lodash/core\');\n// Load the FP build for immutable auto-curried iteratee-first data-last methods.\nvar fp = require(\'lodash/fp\');\n\n// Load method categories.\nvar array = require(\'lodash/array\');\nvar object = require(\'lodash/fp/object\');\n\n// Cherry-pick methods for smaller browserify/rollup/webpack bundles.\nvar at = require(\'lodash/at\');\nvar curryN = require(\'lodash/fp/curryN\');\n</code></pre>\n<p>See the <a href="https://github.com/lodash/lodash/tree/4.17.11-npm">package source</a> for more details.</p>\n<p><strong>Note:</strong><br>\nInstall <a href="https://www.npmjs.com/package/n_">n_</a> for Lodash use in the Node.js &#x3C; 6 REPL.</p>\n<h2>Support</h2>\n<p>Tested in Chrome 68-69, Firefox 61-62, IE 11, Edge 17, Safari 10-11, Node.js 6-10, &#x26; PhantomJS 2.1.1.<br>\nAutomated <a href="https://saucelabs.com/u/lodash">browser</a> &#x26; <a href="https://travis-ci.org/lodash/lodash/">CI</a> test runs are available.</p>',docPath:"argo-ci/node_modules/lodash/readme",proj:"argo-ci"}}}});
